import React from "react";
import './Announcements.css';


function Announcements(){
    let Announcements=['Assignment that takes 2 month but you have one week','something important','there is a new assignment','zooomlink for classss','latex Assignment']

    return(<div class="ann">
    
        <table>
            <tr>
                <th class="table-head"> ANOUNCEMENT </th>
                <th class="table-head"> DESCRIPTION </th>

            </tr>
              {Announcements.map((item =>
                <tr><td>{item}</td>
                    <td> {item.indexOf()} </td>
              </tr> ))}
            </table>
        
        </div>
        )
    ;
;}

export default Announcements;
